import * as React from 'react'
import { Layout, Icon } from 'antd'

import './home.less'

interface Props {
  academy: {
    name: string
    tagline?: string
    facebookLink?: string
    twitterLink?: string
    linkedInLink?: string
    youtubeLink?: string
    homepageContent: string
    aboutUs: string
    addressAndContact: string
  }
}

export class Home extends React.Component<Props> {
  // Hack: react doesn't allow name attribute for anchors
  renderAnchorWithName = (props: any) => {
    return <a {...props} />
  }

  render() {
    return (
      <Layout className="page home">
        <Layout className="banner">
          <div className="wrapper">
            <div className="nav-menu">
              <a href="#about">ABOUT</a>
              <a href="#contact">CONTACT</a>
              <a href="/login">LOGIN</a>
            </div>
            <div className="logo">
              <img src="data:image/png;base64," />
            </div>
            <h3 className="academy-name">{this.props.academy.name}</h3>
            {this.props.academy.tagline && (
              <h4 className="tagline">{this.props.academy.tagline}</h4>
            )}
            <div className="social-container">
              {this.props.academy.facebookLink && (
                <a href={this.props.academy.facebookLink}>
                  <Icon type="facebook" theme="outlined" />{' '}
                </a>
              )}
              {this.props.academy.twitterLink && (
                <a href={this.props.academy.twitterLink}>
                  <Icon type="twitter" theme="outlined" />{' '}
                </a>
              )}
              {this.props.academy.linkedInLink && (
                <a href={this.props.academy.linkedInLink}>
                  <Icon type="linkedin" theme="outlined" />{' '}
                </a>
              )}
              {this.props.academy.youtubeLink && (
                <a href={this.props.academy.youtubeLink}>
                  <Icon type="youtube" theme="outlined" />{' '}
                </a>
              )}
            </div>
          </div>
        </Layout>
        <div className="homepage-content">
          <div
            className="wrapper"
            dangerouslySetInnerHTML={{
              __html: this.props.academy.homepageContent
            }}
          />
        </div>
        <div className="about-us">
          {this.renderAnchorWithName({ name: 'about' })}
          <div
            className="wrapper"
            dangerouslySetInnerHTML={{ __html: this.props.academy.aboutUs }}
          />
        </div>
        <div className="footer">
          {this.renderAnchorWithName({ name: 'contact' })}
          <div
            className="wrapper"
            dangerouslySetInnerHTML={{
              __html: this.props.academy.addressAndContact
            }}
          />
        </div>
      </Layout>
    )
  }
}
